summary.label:
O Aplicativo é para você, usuário Uber Chip e Surf Telecom acessar os serviços de recarga, consulta de saldo (voz, internet e de recarga) e outros, de forma rápida, simples e na hora que quiser.
Com o aplicativo você poderá:

- Realizar a recarga do seu chip Uber Chip e Surf Telecom;
- Consultar seu saldo de voz (minutos);
- Consultar seu saldo de dados (internet);
- Consultar seu sado de recarga (dinheiro em saldo);
- Saber a data de validade de seu plano;
- Histórico das recargas realizadas online (aplicativo, site Uber Chip e Surf Telecom e por SMS).

Você será solicitado a fornecer as seguintes permissões:

- Permissão para acesso à internet;
- Permissão para que o aplicativo faça e gerencie chamadas telefônicas, necessária para a con- Permissões para leitura da agenda e SMS, necessários à validação de tokens de acesso ao aplicativo.sulta de saldo (voz, dados e de recarga);
